  return (
    <Router>
    <div className="flex-row justify-center h-screen bg-gray-100 px-4">
      <div className="flex items-center">
        <img className="w-20" src="/agnos-logo.png" alt="agnos-logo" />
        <h2 className="text-2xl font-bold py-8 leading-7 text-gray-900 sm:truncate sm:text-3xl sm:tracking-tight">
          {/* Welcome to Agnos Health Check */}
        </h2>
      </div>
      <Routes>
        <Route path="/" element={<AbdomenPage />} />
        {/* <Route path="/finger" element={<FingerSelector />} /> */}
      </Routes>
      {/* <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
        <h3 className="text-2xl font-normal mb-6 flex items-center">
          <Bs1CircleFill className="mr-2" />
          Select Pain Areas (Abdomen)
        </h3>
        <div className="mb-6">
          <AbdomenSelector />
          <div className="flex justify-between items-center mt-10">
            <button className="btn btn-primary text-black border-none shadow-none bg-transparent hover:text-primary hover:bg-transparent transition-colors duration-200">
              <BsArrowLeft /> Previous
            </button>
            <button className="btn btn-primary text-black border-none shadow-none bg-transparent hover:text-primary hover:bg-transparent transition-colors duration-200">
              Next <BsArrowRight />
            </button>
          </div>
        </div>
      </div> */}
    </div>
    </Router>
  );
};

export default App;
